import "./about.css"
import Navbar from "./navbar";
function About(){
    const navi={
        firstTitle:"Home",
        firstLink:"/",
       SecondTitle:"Contact",
       SecondLink:"/contact",
    }
    return(
        <div>
            <Navbar titleOne={navi.firstTitle}  titletwo={navi.SecondTitle}  LinkOne={navi.firstLink}  LinkTwo={navi.SecondLink}></Navbar>    
        </div>
    )
}
export default About;
